#include <iostream>
 
using namespace std;
 
int main()
{
    int m, count_pos, total_pos, d_a_m_i, d_a_m_j, diag_comp;
    float ar_mean, diff_ar_mean;
    
    count_pos=0;
    total_pos= 0;
    
    cout << "Ğ’Ğ²ĞµĞ´Ğ¸Ñ‚Ğµ Ñ€Ğ°Ğ·Ğ¼ĞµÑ€ Ğ¼Ğ°ÑÑĞ¸Ğ²Ğ° Ğ’:" << endl;
    cin >> m;
    int B[m][m];
    
    for(int i = 0; i < m; i++)
    {
        for (int j = 0; j < m; j++)
        {
            cin>>B[i][j];
            if (B[i][j] > 0)
            {
                count_pos+=1;
                total_pos+=B[i][j];
            }
        }
    }
    
    ar_mean = total_pos/count_pos;
    
