#include <iostream>
using namespace std;

double lagrange(double x[], double y[], double xx, int n) {
  int i, j;
  double *a, yy = 0;
  a = new double[n];
  for (i = 0; i < n; i++) {
    a[i] = y[i];
    for (j = 0; j < n; j++) {
      if (j == i) continue;
      a[i] *= (xx - x[j]) / (x[i] - x[j]);
    }
    yy += a[i];
  }
  delete a;
  return yy;
}

int main() {
