  double y[] = {1.04403, 1.08462, 1.11803, 1.15603, 1.19817, 1.23223};
  cout << "y|x=0.46 = " << lagrange(x, y, 0.46, 6) << endl;
  cout << "y|x=0.55 = " << lagrange(x, y, 0.55, 6) << endl;
  cout << "y|x=0.60 = " << lagrange(x, y, 0.60, 6) << endl;
  
  return 0;
}

